script: |
  super -f text -I q11788.spq | sort > q11788.out

inputs:
  - name: q11788.spq
    data: |
      SELECT ALL col2 * + + col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col0 / 51 IS NULL OR ( + CAST ( NULL AS INTEGER ) ) / + col1 BETWEEN - + col0 - - ( + + col1 ) + - col0 AND ( 12 );
  - name: tab0

outputs:
  - name: q11788.out
    data: |
      100
      2209
      9801
